export const styles = {
    typography: {
        useNextVariants: true,
    },
    palette: {
        primary: {
            light: '#63ccff',
            main: '#2196f3',
            dark: '#1976d2',
            contrastText: '#fff',
        },
        secondary: {
            main: '#e10050',
            dark: '#9d0038'
        }
    },
};
